pragma solidity ^0.8.0;

import './libraries/Counters.sol';
import './libraries/SafeMath.sol';
import './interfaces/IERC20.sol';
import './interfaces/IRocketStake.sol';
import './interfaces/IRocketStorage.sol';
import './interfaces/IMigrationCompatible.sol';
import './interfaces/IRocketDepositPool.sol';
import './interfaces/IRocketTokenRETH.sol';
import './interfaces/IFlashLender.sol';

contract RocketStake is IRocketStake, IFlashLender {
    using SafeMath for uint256;

    mapping(address => uint256) internal staker_reth_balances;
    address rocket_storage_address;
    bytes32 public constant FLASH_LOAN_CALLBACK_SUCCESS = keccak256("ERC3156FlashBorrower.onFlashLoan");

    constructor(address _rocket_storage_address) {
        rocket_storage_address = _rocket_storage_address;
    }

    receive() external payable {}

    function stake() external payable override {
        require(msg.value > 0, "You must send a non-zero amount of eth to stake.");

        // setup RP contracts
        IRocketStorage rocket_storage = IRocketStorage(rocket_storage_address);
        IRocketDepositPool rocket_deposit_pool = IRocketDepositPool(rocket_storage.getAddress(keccak256(abi.encodePacked("contract.address", "rocketDepositPool"))));
        IRocketTokenRETH rocket_token_reth = IRocketTokenRETH(rocket_storage.getAddress(keccak256(abi.encodePacked("contract.address", "RocketTokenRETH"))));

        // deposit eth into RP and add the amount of rETH created to staker's balance
        uint256 reth_supply_before = rocket_token_reth.balanceOf(address(this));
        rocket_deposit_pool.deposit{ value: msg.value }();
        uint256 reth_supply_after = rocket_token_reth.balanceOf(address(this));
        uint256 reth_added_to_stake = reth_supply_after.sub(reth_supply_before);
        staker_reth_balances[msg.sender] = staker_reth_balances[msg.sender].add(reth_added_to_stake);

        emit AddStake(msg.sender, reth_added_to_stake, msg.value, staker_reth_balances[msg.sender]);
    }

    function withdraw(uint256 eth_amount) external override {
        require(staker_reth_balances[msg.sender] > 0, "Nothing staked here.");
        require(eth_amount > 0, "You must withdraw more than 0 ETH");

        // setup RP contracts
        IRocketStorage rocket_storage = IRocketStorage(rocket_storage_address);
        IRocketTokenRETH rocket_token_reth = IRocketTokenRETH(rocket_storage.getAddress(keccak256(abi.encodePacked("contract.address", "RocketTokenRETH"))));

        // ensure there is enough eth available in RP's system
        require(rocket_token_reth.getTotalCollateral() >= eth_amount, "Not enough collateral available in Rocket Pool");

        // make sure we're not trying to withdraw more ETH than our rETH share is worth
        uint256 eth_able_to_be_withdrawn = rocket_token_reth.getEthValue(staker_reth_balances[msg.sender]);
        require(eth_amount <= eth_able_to_be_withdrawn, "You cannot withdraw more ETH than you have staked.");

        // burn the rETH to receive ETH via RP
        uint256 reth_to_burn = rocket_token_reth.getRethValue(eth_amount);
        uint256 starting_balance = address(this).balance;
        rocket_token_reth.burn(reth_to_burn);
        uint256 eth_received = address(this).balance.sub(starting_balance);

        // deduct the burned rETH from the staker_reth_balances balance
        staker_reth_balances[msg.sender] = staker_reth_balances[msg.sender].sub(reth_to_burn);

        // transfer staker ETH last to prevent re-entrancy
        payable(msg.sender).transfer(eth_received);
        emit AccountWithdraw(msg.sender, eth_received, staker_reth_balances[msg.sender]);
    }

    function migrate(
        address next_contract_address,
        uint256 eth_amount
    ) override public {
        // make sure there is a stake to migrate and that we aren't migrating into a non-existant address
        require(staker_reth_balances[msg.sender] > 0, "You are not staking any ETH");
        require(next_contract_address != address(0), "Cannot migrate to non-existant contract");

        // setup RP
        IRocketStorage rocket_storage = IRocketStorage(rocket_storage_address);
        IRocketTokenRETH rocket_token_reth = IRocketTokenRETH(rocket_storage.getAddress(keccak256(abi.encodePacked("contract.address", "RocketTokenRETH"))));

        // calculate the ETH value of our rETH staked and prevent overdrawing
        uint256 eth_able_to_be_withdrawn = rocket_token_reth.getEthValue(staker_reth_balances[msg.sender]);
        require(eth_amount <= eth_able_to_be_withdrawn, "You cannot migrate that much.");

        // find the exact amount of rETH to transfer and decrement staked_reth balance
        uint256 reth_amount = rocket_token_reth.getRethValue(eth_amount);
        staker_reth_balances[msg.sender] = staker_reth_balances[msg.sender].sub(reth_amount);

        // go through the transfer protocol, buyer beware
        IMigrationCompatible(next_contract_address).startTransfer(reth_amount, msg.sender);
        rocket_token_reth.transfer(next_contract_address, reth_amount);
        IMigrationCompatible(next_contract_address).closeTransfer(reth_amount, msg.sender);
    }

    function accountStakedETH(address staker) override public view returns(uint256 staked_eth) {
        IRocketStorage rocket_storage = IRocketStorage(rocket_storage_address);
        IRocketTokenRETH rocket_token_reth = IRocketTokenRETH(rocket_storage.getAddress(keccak256(abi.encodePacked("contract.address", "RocketTokenRETH"))));
        return rocket_token_reth.getEthValue(staker_reth_balances[staker]);
    }

    function totalRETHCollateral() external override view returns(uint256 collateral) {
        IRocketStorage rocket_storage = IRocketStorage(rocket_storage_address);
        IRocketTokenRETH rocket_token_reth = IRocketTokenRETH(rocket_storage.getAddress(keccak256(abi.encodePacked("contract.address", "RocketTokenRETH"))));
        return rocket_token_reth.getTotalCollateral();
    }

    function totalRETHHeld() external override view returns(uint256 collateral) {
        IRocketStorage rocket_storage = IRocketStorage(rocket_storage_address);
        IRocketTokenRETH rocket_token_reth = IRocketTokenRETH(rocket_storage.getAddress(keccak256(abi.encodePacked("contract.address", "RocketTokenRETH"))));
        return rocket_token_reth.balanceOf(address(this));
    }

    function totalETHHeld() external override view returns(uint256 collateral) {
        IRocketStorage rocket_storage = IRocketStorage(rocket_storage_address);
        IRocketTokenRETH rocket_token_reth = IRocketTokenRETH(rocket_storage.getAddress(keccak256(abi.encodePacked("contract.address", "RocketTokenRETH"))));
        return rocket_token_reth.getEthValue(rocket_token_reth.balanceOf(address(this)));
    }

    // https://eips.ethereum.org/EIPS/eip-3156
    function flashLoan(
        IFlashBorrower receiver,
        address token,
        uint256 amount,
        bytes calldata data
    ) external override returns(bool) {
        IRocketStorage rocket_storage = IRocketStorage(rocket_storage_address);
        IRocketTokenRETH rocket_token_reth = IRocketTokenRETH(rocket_storage.getAddress(keccak256(abi.encodePacked("contract.address", "RocketTokenRETH"))));
        require(address(rocket_token_reth) == token, 'FlashLender: Unsupported currency');
        require(IERC20(token).transfer(address(receiver), amount), 'FlashLender: Transfer failed');
        require(
            receiver.onFlashLoan(msg.sender, token, amount, 0, data) == FLASH_LOAN_CALLBACK_SUCCESS, 
            'FlashLender: Callback failed'
        );
        require(
            IERC20(token).transferFrom(address(receiver), address(this), amount),
            "FlashLender: Repay failed"
        );
        return true;
    }

    // https://eips.ethereum.org/EIPS/eip-3156
    function flashFee(
        address token,
        uint256
    ) external view override returns(uint256) {
        IRocketStorage rocket_storage = IRocketStorage(rocket_storage_address);
        IRocketTokenRETH rocket_token_reth = IRocketTokenRETH(rocket_storage.getAddress(keccak256(abi.encodePacked("contract.address", "RocketTokenRETH"))));
        require(
            address(rocket_token_reth) == token,
            "FlashLender: Unsupported currency"
        );
        return 0;
    }

    // https://eips.ethereum.org/EIPS/eip-3156
    function maxFlashLoan(
        address token
    ) external view override returns (uint256) {
        IRocketStorage rocket_storage = IRocketStorage(rocket_storage_address);
        IRocketTokenRETH rocket_token_reth = IRocketTokenRETH(rocket_storage.getAddress(keccak256(abi.encodePacked("contract.address", "RocketTokenRETH"))));
        return token == address(rocket_token_reth) 
            ? IERC20(token).balanceOf(address(this)) 
            : 0;
    }
}","keccak256":"0x6b108e08836c57b2459239afee9da576c3080b96bc3d25a7823292d5bb38e192","license":"AGPL-1.0"},"contracts/interfaces/IERC20.sol":{"content":"// SPDX-License-Identifier: AGPL-1.0
